    return(
        <Div0>
            <BesideTop>
                <Logo>
                    <img src='https://i.imgur.com/BJ21wvu.png'  height={56} width={87.5}></img>
                </Logo>
                <HeaderList>
                    <LogoText>
                        管理系統
                    </LogoText>
                </HeaderList>
            </BesideTop>
            <BesideMid>

            </BesideMid>
            <BesideBot>

            </BesideBot>
        </Div0>
    )
}
export default BesideInner;
